import Button from '@mui/material/Button';
import { Box  } from '@mui/system';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import ModeEditIcon from '@mui/icons-material/ModeEdit';
import DeleteIcon from '@mui/icons-material/Delete';
function App() {
  return (
    <>
    <header>
      <a href="">Employee Sheet</a>
      <Box>
        <Button variant="contained" color="secondary"> <PersonAddIcon/> ADD NEW</Button>
      </Box>
    </header>

  <div className="container">
  <Table sx={{ minWidth: 650 }} aria-label="simple table">
    <TableHead className="bg-light mt-5">
      <TableRow>
        <TableCell>No</TableCell>
        <TableCell>Name</TableCell>
        <TableCell>Email</TableCell>
        <TableCell>Phone</TableCell>
        <TableCell>Address</TableCell>
        <TableCell>Action</TableCell>
      </TableRow>
    </TableHead>
    <TableBody>
      <TableCell>1</TableCell>
      <TableCell>Ashish</TableCell>
      <TableCell>kohliashish@gmail.com</TableCell>
      <TableCell>1234456587</TableCell>
      <TableCell>Rishikesh</TableCell>
      <TableCell>
        <a href="/edit"> <ModeEditIcon/> </a>
        <a href="/delete" className="bg-danger"> <DeleteIcon/> </a>
      </TableCell>
    </TableBody>
  </Table>
  </div>
 </> );
}

export default App;
